import React from 'react';
import './App.css';
import { Link } from 'react-router-dom';
import { whileStatement } from '@babel/types';

function Nav() {
    const navStyle = {
        color: 'white'
    };

    return (
        <nav>
            <h3>Logo</h3>
            <ul className="nav-links">
                <Link to="/">
                    <li>Home</li>
                </Link>
                <Link to="/phonemes">
                    <li>Phonemes</li>
                </Link>
                <Link to="/testing">
                    <li>Testing</li>
                </Link>
            </ul>
        </nav>
    );
}
export default Nav;
